style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("feedhq.org") {
  body, #header, #footer {
    background-color: #1F1F1F;
    color: #D8E6CA;
  }
  a, a:hover, .entry.new a, .entry.new a:hover, .navlist a, .navlist a:hover, .ct {
    color: #D8E6CA;
  }
  #entries .empty {
    background-color: #363636;
  }
}
